const AIntro = () => {
  return (
    <>
        <p className="m-4" style={{fontSize:"20px"}}>At <span className="text-primary"><b>iNoteBook</b></span>, we provide a secure and user-friendly platform for you to organize and manage your notes effortlessly. To access the full suite of features, we've implemented a secure login system to protect your data.</p>
    </>
  );
};

export default AIntro;
